import React from 'react'; //shortcut is "rafce" to create the whole import and function
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
// import { BsList } from 'react-icons/bs';

function Navigation() {
	return (
		<>
			<Navbar className="navbar-bg" expand="lg">
				<Navbar.Brand href="#home">
					<img
						src="https://react-bootstrap.github.io/logo.svg"
						width="30"
						height="30"
						className="d-inline-block align-top"
						alt="React Bootstrap logo"
					/>{' '}
					<span className="logo-name">React Bootstrap</span>
				</Navbar.Brand>

				<Navbar.Toggle aria-controls="basic-navbar-nav" />
				<Navbar.Collapse id="basic-navbar-nav">
					<Nav className="justify-content-end" style={{ width: '100%' }}>
						<Nav.Link className="nav-text" href="#home">
							Home
						</Nav.Link>
						<Nav.Link className="nav-text" href="#link">
							Link
						</Nav.Link>
					</Nav>
				</Navbar.Collapse>
			</Navbar>
		</>
	);
}

export default Navigation;
